import axios from 'axios'
import { act } from 'react-dom/test-utils'
const baseUrl = 'http://localhost:3001/persons'

const getAll = () => {
    return axios.get(baseUrl)
}

const create = newName => {
    return axios.post(baseUrl, newName)
}

export default {
    getAll: getAll,
    create: create
}
